const Title = (props) => {
  return <h1>{props.text}</h1>;
};

const Heading = (props) => {
  return (
    <div>
      <h1>{props.title}</h1>
      <h2>{props.subtitle}</h2>
    </div>
  );
};

const ImageView = (props) => {
  return <img src={props.src}></img>;
};

export { Title, Heading, ImageView };
